import React, { Component} from 'react';
import './App.css';
import image from './cover.jpg';
class App extends Component {
  render() {
  return (
    <div className = "cover" style= {{backgroundImage: `url(${image})`, overflow: 'hidden', position: 'fixed', width: '100%', height: '100vh', backgroundPosition: 'bottom left', backgroundSize: 'cover'}}>
      <head>
        <title>Judy Zhang</title>
      </head>
      <body>
        <ul>
          <li>JZ</li>
          <li>Home</li>
          <li>About Me</li>
          <li>Gallery</li>
         </ul>
        </body>
      </div>
  );
  }
}

export default App;

